text:
@evelyn_sharma turns into a social entrepreneur for women influencers

the ‚Äòyaariyan‚Äô actress evelyn sharma speaks about her views on the #metoo movement that has currently hit bollywood‚Äôs shores, she speaks about how she is currently focusing on giving women in the entertainment industry a safe backing by turning into a social entrepreneur with her new venture, her very own image development company which caters to women influencers.

sharma, who started her career as an international model in 2008 and debuted in her first bollywood film in 2012, says: ‚Äúi‚Äôve been in this industry for a long time and have experienced a lot of disrespectful behavior towards women. i left the talent agency that managed me in the start of my film career because of that reason and since then hired and trained my own team. it‚Äôs a common thing to say that a girl (or boy) needs a godfather to make it in the industry, but i would like to differ. i think it needs talent, good management, and a big portion of courage to stick to your own beliefs. i never had a godfather, however i make a great living off the kind of projects i choose and get to work with amazing people. there will always be trolls trying to stand in your way, but that‚Äôs no reason to give up! the whole world will tell you what path to take, how to look, and whom to fraternize with - but who are you and what are your dreams? i‚Äôve discovered being true to yourself is where real happiness awaits you and had the honor to encourage others by sharing my story of overcoming struggles with identity at various events, like the us president‚Äôs national prayer breakfast in washington d.c.‚Äù witnessing all the change this movement is bringing, she came across an idea of how she could better the situation by helping women influencers and celebrities, that‚Äôs when her idea was born. she decided to build a strong team of professionals for herself and for her friends in the industry to help them grow and release her full potential. she believes that we are all in the process of growing and realizing our own potential, in her words, we are all a ‚Äúwork in progress‚Äù, and need a slight push to reach our full potential. her new venture wip creat

